// Auto-generated data file (offline-friendly)

// Cache for processed industrial zones data
let industrialZonesCache = null;

// Load and parse industrial zones from geojson
async function loadIndustrialZones() {
  if (industrialZonesCache) return industrialZonesCache;
  
  try {
    const response = await fetch('industrial_zones.geojson');
    const geojson = await response.json();
    
    industrialZonesCache = {
      features: geojson.features || [],
      zones: parseZonesData(geojson.features || []),
      byProvince: {},
      byType: {},
      byKind: {}
    };
    
    // Index by province
    industrialZonesCache.zones.forEach(zone => {
      if (!industrialZonesCache.byProvince[zone.province]) {
        industrialZonesCache.byProvince[zone.province] = [];
      }
      industrialZonesCache.byProvince[zone.province].push(zone);
    });
    
    // Index by type
    industrialZonesCache.zones.forEach(zone => {
      if (!industrialZonesCache.byType[zone.type_id]) {
        industrialZonesCache.byType[zone.type_id] = [];
      }
      industrialZonesCache.byType[zone.type_id].push(zone);
    });
    
    // Index by kind (CCN, KCN, IZ)
    industrialZonesCache.zones.forEach(zone => {
      if (!industrialZonesCache.byKind[zone.kind]) {
        industrialZonesCache.byKind[zone.kind] = [];
      }
      industrialZonesCache.byKind[zone.kind].push(zone);
    });
    
    return industrialZonesCache;
  } catch (error) {
    console.error('Error loading industrial zones:', error);
    return { features: [], zones: [], byProvince: {}, byType: {}, byKind: {} };
  }
}

// Parse and clean zone data from geojson features
function parseZonesData(features) {
  return features.map(feature => {
    const props = feature.properties || {};
    return {
      id: props.code || null,
      name: props.name || 'N/A',
      code: props.code || null,
      address: props.address || '',
      province: props.province || '',
      price: parseFloat(props.price) || 0,
      acreage: props.acreage || 0,
      occupancy: props.occupancy || 0,
      type: props.type_id || null,
      kind: props.kind || 'CCN',
      typeAction: props.type_action || null,
      typeLevelUp: props.type_level_up || null,
      careerId: props.career_id || null,
      accepted: props.accepted === true,
      provinceId: props.province_id || null,
      districtId: props.district_id || null,
      communeId: props.commune_id || null,
      source: props.source || 'api.iipvietnam.vn',
      images: props.images || null,
      updatedAt: props.updated_at || null,
      coordinates: feature.geometry?.coordinates || [null, null],
      latitude: feature.geometry?.coordinates[1] || null,
      longitude: feature.geometry?.coordinates[0] || null
    };
  });
}

// Helper functions

// Get zones by province
function getZonesByProvince(province) {
  if (!industrialZonesCache) return [];
  return industrialZonesCache.byProvince[province] || [];
}

// Get zones by kind (CCN, KCN, IZ, etc)
function getZonesByKind(kind) {
  if (!industrialZonesCache) return [];
  return industrialZonesCache.byKind[kind] || [];
}

// Search zones by name
function searchZones(query) {
  if (!industrialZonesCache) return [];
  const q = query.toLowerCase();
  return industrialZonesCache.zones.filter(zone =>
    zone.name.toLowerCase().includes(q) ||
    zone.code.toLowerCase().includes(q) ||
    zone.address.toLowerCase().includes(q)
  );
}

// Get zone by code
function getZoneByCode(code) {
  if (!industrialZonesCache) return null;
  return industrialZonesCache.zones.find(z => z.code === code);
}

// Get zones within price range
function getZonesByPriceRange(minPrice, maxPrice) {
  if (!industrialZonesCache) return [];
  return industrialZonesCache.zones.filter(zone =>
    zone.price >= minPrice && zone.price <= maxPrice
  );
}

// Get available zones (occupancy < 100%)
function getAvailableZones() {
  if (!industrialZonesCache) return [];
  return industrialZonesCache.zones.filter(zone => zone.occupancy < 100);
}

// Get zones stats
function getZonesStats() {
  if (!industrialZonesCache) return {};
  
  const stats = {
    totalZones: industrialZonesCache.zones.length,
    totalArea: 0,
    totalOccupancy: 0,
    provinces: {},
    kinds: {},
    averagePrice: 0,
    priceRange: { min: Infinity, max: -Infinity }
  };
  
  industrialZonesCache.zones.forEach(zone => {
    stats.totalArea += zone.acreage || 0;
    stats.totalOccupancy += zone.occupancy || 0;
    stats.averagePrice += zone.price || 0;
    
    if (zone.price > 0) {
      stats.priceRange.min = Math.min(stats.priceRange.min, zone.price);
      stats.priceRange.max = Math.max(stats.priceRange.max, zone.price);
    }
    
    // Count by province
    if (zone.province) {
      stats.provinces[zone.province] = (stats.provinces[zone.province] || 0) + 1;
    }
    
    // Count by kind
    if (zone.kind) {
      stats.kinds[zone.kind] = (stats.kinds[zone.kind] || 0) + 1;
    }
  });
  
  stats.averagePrice = Math.round(stats.averagePrice / industrialZonesCache.zones.length * 100) / 100;
  stats.averageOccupancy = Math.round(stats.totalOccupancy / industrialZonesCache.zones.length * 100) / 100;
  
  return stats;
}
